import React, { useState, useEffect } from 'react';
import './cars.css';
import Sidebar from '../Sidebar/sidebar';

const Cars = ({ user }) => {
  const [cars, setCars] = useState([]);
  useEffect(() => {
    fetch(`http://localhost:5000/dashboard/cars/${user.googleId}`)
      .then(response => response.json())
      .then(data => {
        console.log(data);
        setCars(data);
      })
      .catch(error => console.error(error));
  }, [user.googleId]);
  return (
    <>
      <Sidebar user={user} />
      <div className="bigbox">
        <h1>YOUR CARS</h1>
        <table className="users-table">
          <thead>
            <tr>
              <th>Number</th>
              <th>Plate Number</th>
              <th>Brand + Model</th>
              <th>Year</th>
              <th>HP</th>
              <th>VIN</th>
              <th>Telephone</th>
              <th>Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {cars.map(car => (
              <tr key={car._id}>
                <td>{index + 1}</td>
                <td>{car.carRegiNr}</td>
                <td>{car.carBrand} {car.carModel}</td>
                <td>{car.carYear}</td>
                <td>{car.carHP} hp</td>
                <td>{car.carVIN}</td>
                <td>{car.telephone}</td>
                <td>{car.status === 'TBApproved' ? 'To Be Approved' : (car.status)}</td>
                <td className="user-controls">
                  <button>Edit</button>
                  <button>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  )
}

export default Cars;
